    render(){
        return (
            <WriterWrapper>
                <WriterTitle>
                    推荐作者
                    <WriterChange>换一批</WriterChange>
                </WriterTitle>
                <Author></Author>
            </WriterWrapper>
        )
    }
}
export default Writer;
